/****** Object:  Trigger [dbo].[trg_UpdateBookAndOrderQuanlity]    Script Date: 9/22/2025 12:03:02 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE TRIGGER [dbo].[trg_UpdateBookAndOrderQuanlity]
ON [dbo].[Order_Detail]
AFTER INSERT
AS
BEGIN
    -- Tắt thông báo "(1 row(s) affected)" để trigger chạy mượt hơn
    SET NOCOUNT ON;

    -- Cập nhật số lượng sách tồn kho trong bảng Book
    -- Lấy số lượng từ bảng INSERTED (bảng ảo chứa các dòng vừa được thêm vào)
    -- và trừ đi số lượng hiện tại của sách tương ứng.
    UPDATE B
    SET B.quanlity = B.quanlity - I.quanlity
    FROM 
        dbo.Book B
    INNER JOIN (
        SELECT book_id, CAST(quanlity AS INT) AS quanlity
        FROM INSERTED
    ) I ON B.Id = I.book_id;


    -- Cập nhật tổng số sách trong bảng Order
    -- Tính tổng số lượng sách được thêm cho mỗi đơn hàng và cộng vào cột total_book
    UPDATE O
    SET O.total_book = ISNULL(O.total_book, 0) + AggregatedInserted.TotalQuanlity
    FROM 
        dbo.[Order] O
    INNER JOIN (
        SELECT order_id, SUM(CAST(quanlity AS INT)) AS TotalQuanlity
        FROM INSERTED
        GROUP BY order_id
    ) AS AggregatedInserted ON O.Id = AggregatedInserted.order_id;
END;
GO
ALTER TABLE [dbo].[Order_Detail] ENABLE TRIGGER [trg_UpdateBookAndOrderQuanlity]
GO
